function SignUppage(){
	
	return (
		<div className="page home">
               <div className="homeText">
                    <h1>
                         Decollez votre carriere numerique grace a notre aide !
                    </h1>
                    <div classNamte="cta">
                         <button className="button primBtn">s'inscire</button>
                         <button className="button secBtn">En savoir plus</button>
                    </div>
               </div>
          </div>
	)
}

function LoginPage(){
	
